import { Grid, Avatar, InputLabel, Input } from '@material-ui/core';
import React from 'react';
import nikklaus from './nikklaus.jpg'
const Posts = () => {
    return ( 
        <Grid container style={{marginTop:'20px'}}>
          <div className="avatar"> <Avatar style={{height:'60px',width:'60px',marginLeft:'20px'}} src={nikklaus}/> 
          </div> 
         <div> 
             <input style={{width:'400px',height:'30px',marginTop:'10px', borderRadius:'99px', paddingLeft:'20px',marginLeft:'10px'}} type="text" placeholder="What's on your mind dawg?"/>
             </div> 
        </Grid>

 

);
}

export default Posts;
